import React, { Component } from 'react';
import './PopCheckboxesStyles.scss';


class PopCkeckBoxes extends Component {
	constructor() {
		super();

    // this.handleCheckboxChange = this.handleCheckboxChange.bind(this);
    // this.handleSubmit = this.handleSubmit.bind(this);
	}



	render() {
		return(
			<div className="pop_checkbox_container">
			  <input id="album_checkbox" ref="album_check" type="checkbox" className='pop_checkboxes' />
			  <label for="album_checkbox">Same Album</label>

			  <input id="artiste_checkbox" ref="artiste_check" type="checkbox" className='pop_checkboxes' />
			  <label for="artiste_checkbox">This Artiste</label>

			  <input id="genre_checkbox" ref="genre_check" type="checkbox" className='pop_checkboxes' />
			  <label for="genre_checkbox">Genre</label>

			  <input id="era_checkbox" ref="era_check" type="checkbox" className='pop_checkboxes' />
			  <label for="era_checkbox">Year/Era</label>

			  <input id="associate_checkbox" ref="associate_check" type="checkbox" className='pop_checkboxes' />
			  <label for="associate_checkbox">Associate Artiste</label>
			</div>
		);
	}
}



export default PopCkeckBoxes;




